#!/usr/bin/perl
#
# There is a GB18030 32-bit table at the data section of
# this script. It would show the mapping from gb18030 to
# unicode.
#

use strict;

my $debug = 0;
binmode STDOUT;

sub tobin($)
{
	my $str = shift;
	my ($mm, $nn) = ( $str =~ m/(..)(..)/ );
	print "mm($mm), nn($nn)\n" if $debug;

	my $res = chr(hex($mm)) . chr(hex($nn));
	return $res;
}

sub write_bytes($$$)
{
	my ($mm, $nn, $uu) = @_;

	print "a($mm) b($nn) c($uu)\n" if $debug;

	print tobin($mm), tobin($nn), "\t", $mm,$nn, "\t", $uu,"\n";
}

my $count = 0;
while (<DATA>)  {
	if ( m/\{(.*)\},/ )  {
		$count ++;
		my @num = split /,\s/, $1;
#		print join "=", @num, "\n";

		my ($a, $b, $c) = @num;
		$a =~ s/0x//;
		$b =~ s/0x//;
		$c =~ s/0x/U\+/;
		write_bytes($a, $b, $c);
		#print "a($a) b($b) c($c)\n" if $debug;
		#print STDERR "$count\r";
	}
}
print STDERR "count = $count\n";

